#!/bin/bash
# vLLM 请求 base64 图像格式: data:image/png;base64,<base64>
B64="${VL_IMAGE_B64:-}"

# 3. 使用 base64 图像请求 vLLM（格式: data:image/png;base64,<base64>）
# 用 jq 构建 JSON 并通过 stdin 传递，避免命令行长度和转义问题
jq -n \
    --arg b64 "$B64" \
    --arg model "models/Qwen3-VL-8B-Instruct-FP8" \
    '{
        model: $model,
        messages: [
            {role: "user", content: [
                {type: "text", text: "请理解并描述图中的场景。"},
                {type: "image_url", image_url: {url: ("data:image/png;base64," + $b64)}}
            ]}
        ]
    }' | curl -s http://localhost:8001/v1/chat/completions \
    -H "Content-Type: application/json" \
    -d @-
